import App from './App';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import React, {useState} from 'react';

function Routing() {
    const[url,setUrl]=useState("home");
    return (
 <div>
    <div className="Nav">
            <div className="inner">
                <span onClick={()=>setUrl("home")}>Home</span>
                <span onClick={()=>setUrl("login")}>Login</span>
                <span onClick={()=>setUrl("mypage")}>Mypage</span>
                <span onClick={()=>setUrl("qna")}>Qna</span>
                <span onClick={()=>setUrl("store")}>Store</span>
    
            </div>
        </div>
 </div>

    );
}

export default Routing;
